  false,\n\t\"url\": null,\n\t\"notes\": \"In July, 1981, Region 7 of the U.S. Fish
  and Wildlife Service issued the New York State Department of Environmental Conservation
  (DEC), a permit to take 21 young bald eagles from southeast Alaska and transport
  them to the State of New York. The purpose of this report is the describe the implementation
  of this project, present bald eagle productivity data acquired during associated
  nest surveys, and document the actual nesting habitat affected.\",\n\t\"license_title\":
